import React, { useState } from 'react';
import './App.css';
import InputField from "./components/InputText";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function App() {
  function handleSubmit(e) {
    // Prevent the browser from reloading the page
    e.preventDefault();

    // Read the form data
    const form = e.target;
    const formData = new FormData(form);

    // You can pass formData as a fetch body directly:
    //fetch('/some-api', { method: form.method, body: formData });

    // Or you can work with it as a plain object:
    const formJson = Object.fromEntries(formData.entries());
    console.log(formJson);
  }
  return (
      <Container>
          <br/>
          <br/>
          <Row>
              <Col>Origin Address</Col>
              <Col>Destination Address</Col>
          </Row>
          <Row>
              <Col>
                  <label>
                      Address Line 1: <input name="inputOriginAddressLine" defaultValue="" />
                  </label>
                  <label>
                      City: <input name="inputOriginCity" defaultValue="" />
                  </label>
              </Col>
              <Col>
                  <label>
                      PostalCode: <input name="inputOriginPostalCode" defaultValue="" />
                  </label>
                  <Combobox
                      data={colors}
                      dataKey='id'
                      textField='name'
                      defaultValue={1}
                  />
              </Col>
              <Col>
                  <label>
                      Address Line 1: <input name="inputDestinationAddressLine" defaultValue="" />
                  </label>
              </Col>
              <Col>
                  <label>
                      PostalCode: <input name="inputDestinationPostalCode" defaultValue="" />
                  </label>
              </Col>
          </Row>
      </Container>

  );
}

export default App;
